  true,\n\t\"url\": null,\n\t\"notes\": \"Aggregated Computational Toxicology Online
  Resource (AcTOR) is EPA's online aggregator of all the public sources of chemical
  toxicity data. ACToR aggregates data from over 1,000 public sources on over 500,000
  chemicals and is searchable by chemical name, other identifiers and by chemical
  structure. It can be used to query a specific chemical and find all publicly available
  hazard, exposure and risk assessment data. It also provides access to EPA's ToxCast,
  ToxRefDB, DSSTox, Dashboard and DSSTox data.\",\n\t\"license_title\": \"Other License
